        'job_description':
          '• Currently considering candidates residing in DMV area only. Others will not be considered at this time. MINIMUM 7+ years of experience required.\n\nWe are seeking a Backend Java Developer with experience in developing J2EE applications using REST/JSON, Spring, SpringBoot, J2EE. Designs, develops, and implements web-based Java applications to support business requirements. Follows approved Agile life cycle methodologies, creates design documents & performs program coding. Resolves technical issues through debugging, research, and investigation.\n\nRequired Skills:\n• Strong knowledge and project experience in Java Technologies like J2EE, JSP, Servlets, JDBC, Spring, Springboot, JPA, Web Services (REST), XSLT, XML\n• Strong experience with production support and issue resolution\n• Experience with documenting technical specifics and/or tech design\n• Experience designing and performing unit testing, functional testing, and code reviews\n• Experience with application frontend code bases such as HTML, JSP, JavaScript, jQuery, and CSS\n• Experience with Database design including Stored Procedures, DML and DDL tasks\n• Experience with the GIT version control and familiarity with code repository hosting services such as GitHub and BitBucket\n• Experience building/converting projects to Maven platform\n• Knowledge of CI/CD tooling i.e. Jenkins/Docker/AWS/webhooks\n\nPreferred Skills:\n• Experience working with in an Agile development environment\n• Experience with AWS features like AWS SDK, S3, SNS/SQS, SES, Lambda functions\n• Experience with JIRA and Confluence, or other project/issue tracking software\n• Excellent communication and teamwork skills\n• Excellent problemsolving skills, including identifying areas for improvement to processes or applications\n• Experience with modern JavaScript MVC frameworks such as EmberJS, React, Angular, Bootstrap\n• Experience with performance tools, and handson debugging skills on any preferred IDE\n• Experience with Sybase and/or Postgres databases\n• Knowledge of Docker, Kubernetes and deployment Pipelines\n\nAbout Surge InfoTech LLC\nWe are an IT Consulting Company specializing in transformative solutions. We provide comprehensive services including Enterprise Architecture, Application Modernization, and Talent Management. With a focus on innovation and efficiency, we empower businesses to navigate the complexities of the digital landscape. Our dedicated team of experts collaborates closely with clients to optimize their IT infrastructure, streamline applications, and cultivate a high-performing workforce. Through cutting-edge technologies and strategic insights, we drive sustainable growth and enhance operational excellence for organizations of all sizes.',
