        'job_description':
          "Expedia Group brands power global travel for everyone, everywhere. We design cutting-edge tech to make travel smoother and more memorable, and we create groundbreaking solutions for our partners. Our diverse, vibrant, and welcoming community is essential in driving our success.\n\nWhy Join Us?\n\nTo shape the future of travel, people must come first. Guided by our Values and Leadership Agreements, we foster an open culture where everyone belongs, differences are celebrated and know that when one of us wins, we all win.\n\nWe provide a full benefits package, including exciting travel perks, generous time-off, parental leave, a global hybrid work setup (with some pretty cool offices), and career development resources, all to fuel our employees' passion for travel and ensure a rewarding career journey. We’re building a more open world. Join us.\n\nIntroduction to the team\n\nExpedia's Service Data team is seeking a skilled and enthusiastic Software Development Engineer proficient in data engineering and software development. This role entails designing, developing, and implementing batch and real-time ETL pipelines to generate domain datasets, providing essential insights to partners and decision-makers. Additionally, the role requires expertise in frontend and backend development to enhance user interfaces, delivering actionable insights to stakeholders. Collaborating across departments and organizational levels, the candidate will understand requirements, design solutions, and add value through an agile development approach.\n\nThe ideal candidate will demonstrate technical and functional proficiency in building data streaming and backend applications from the ground up. Effective collaboration within cross-functional teams is crucial for successful project delivery. Key attributes for this role include an energetic attitude, innovative problem-solving skills, a passion for technology and data, excellent communication and relationship-building abilities, as well as adaptability in approach and design.\n\nIn this role, you will:\n• Join our development team and engage in all stages of the software development lifecycle, including requirements gathering, design, development, testing, deployment, and maintenance\n• Address intricate business challenges using disciplined development methodologies, crafting scalable, flexible, and efficient solutions with suitable technologies\n• Offer innovative and straightforward resolutions to complex issues, prioritizing execution and fostering a culture of experimentation and learning\n• Produce clean, well-documented code to ensure clarity and maintainability\n• Continuously refine our development and delivery processes to optimize efficiency and effectiveness\n• Contribute to a collaborative and supportive software development environment, fostering mutual learning and innovation through peer code reviews\n• Provide guidance and mentorship to junior developers, aiding in their understanding and implementation of project methodologies\n• Adapt to changing priorities and business requirements, remaining flexible in approach and willing to learn new technologies and methodologies as needed\n• Possess excellent communication skills, effectively conveying ideas to colleagues and stakeholders, while providing thorough explanations of approaches. Maintain comprehensive documentation to ensure clarity and transparency\n• Demonstrated capability to collaborate effectively with peers, leaders, and various business units\n\nExperience and qualifications:\n• Bachelor’s degree in Business, Computer Science, Information Systems, or equivalent relevant professional experience. 2-5 years of experience in data engineering and software development\n• High level of technical expertise, adept at problem-solving and applying critical thinking\n• Solid grasp of software design principles, algorithms, and data structures\n• Experience in Agile methodology is essential, with the capacity to work under pressure and meet deadlines with quality\n• Previous experience with distributed systems and fault tolerance development\n• Experience with relational databases and NoSQL distributed databases (e.g. ScyllaDB)\n• Experience with AWS Cloud technology for scalability and reliability\n• Proficiency in a development language such as Python, Scala, Kotlin, or similar\n• Experience with Apache Spark, Qubole, Spring Framework and Confluent Kafka\n• Knowledge of stateful stream processing (e.g. Faust, Java KafkaConsumer, KafkaProducer and KafkaStreams)\n• Familiarity with backend development frameworks and libraries, such as springboot\n• Experience with version control systems such as Git and continuous integration/continuous deployment (CI/CD) pipelines\n\nThe total cash range for this position in Seattle is $112,000.00 to $156,500.00. Employees in this role have the potential to increase their pay up to $179,000.00, which is the top of the range, based on ongoing, demonstrated, and sustained performance in the role.\n\nStarting pay for this role will vary based on multiple factors, including location, available budget, and an individual’s knowledge, skills, and experience. Pay ranges may be modified in the future.\n\nAccommodation requests\n\nIf you need assistance with any part of the application or recruiting process due to a disability, or other physical or mental health conditions, please reach out to our Recruiting Accommodations Team through the Accommodation Request.\n\nWe are proud to be named as a Best Place to Work on Glassdoor in 2024 and be recognized for award-winning culture by organizations like Forbes, TIME, Disability:IN, and others.\n\nExpedia Group's family of brands includes: Brand Expedia®, Hotels.com®, Expedia® Partner Solutions, Vrbo®, trivago®, Orbitz®, Travelocity®, Hotwire®, Wotif®, ebookers®, CheapTickets®, Expedia Group™ Media Solutions, Expedia Local Expert®, CarRentals.com™, and Expedia Cruises™. © 2024 Expedia, Inc. All rights reserved. Trademarks and logos are the property of their respective owners. CST: 2029030-50\n\nEmployment opportunities and job offers at Expedia Group will always come from Expedia Group’s Talent Acquisition and hiring teams. Never provide sensitive, personal information to someone unless you’re confident who the recipient is. Expedia Group does not extend job offers via email or any other messaging tools to individuals with whom we have not made prior contact. Our email domain is @expediagroup.com. The official website to find and apply for job openings at Expedia Group is careers.expediagroup.com/jobs.\n\nExpedia is committed to creating an inclusive work environment with a diverse workforce. All qualified applicants will receive consideration for employment without regard to race, color, religion, gender, gender identity or expression, sexual orientation, national origin, genetics, disability, age, or veteran status. This employer participates in E-Verify. The employer will provide the Social Security Administration (SSA) and, if necessary, the Department of Homeland Security (DHS) with information from each new employee's I-9 to confirm work authorization.",
