        'job_description':
          "THE ROLE\nAt theCut, the brand loyalty we've maintained is born from true love of our product. Users appreciate the care and craftsmanship that goes into each release. We need you to help us continue to build the premier barbershop experience for our users. You’ll need to be a top notch problem solver with an edge - we’re adding ten's of thousands of users every week so you’ll have to learn fast and be quick on your feet.\nWe’re looking for an Backend Engineer who will take a key role on our team. You should have knowledge in all stages of software development. You’ll be working alongside our CTO and development team, collaborating on the various layers of our backend services. THE RESPONSIBILITIES\nCollaborate with the product and engineering team to design, implement, and launch new features and products\nFix bugs and address issues as they arise\nMaintain code quality, integrity and organization\nDefine, codify, and establish the standards for high quality software\nStaying in the loop and on top of the latest standards, changes, trends in the software field\nConstantly be learning and developing your personal skills WHAT WE'RE LOOKING FOR\nBachelor’s degree in Computer Science or related field\n5+ years experience in software development\nExperience with Node.js\nExperience with Typescript\nExperience developing high quality scalable/secure backends\nExperience with software testing techniques\nProficient in Git\nAttention to detail and critical problem solving skills\nExperience as an engineer in both an early stage startup and a fully scaled company\nPassion for theCut and barbershop culture\nYou’ve booked a haircut on theCut BENEFITS\nGreat medical, dental, and vision insurance options\nStudent loan repayment plan\n401(k) plan to help save for your future\nUnlimited paid time off\nHealth and wellness stipend\nFree lunch and snacks\nFree company swag\nFree haircuts through theCut",
