        'job_description':
          "Expedition Technology (EXP), is seeking motivated software engineers to join our Umbra team, whose mission is to develop, deploy, and maintain the Training Data Storefront (TDS). TDS is a central repository of AI/ML annotations and models serving the entire Department of Defense (DoD) and Intelligence Community (IC). TDS plays a fundamental role in addressing today’s critical defense and intelligence problems.\n\nWe are seeking Senior Software Engineers who thrive on backend development. We’re looking for engineers who ensure that security, performance, maintainability, scalability, usability and reliability are considered when architecting solutions. We hire people who excel at what they do and empower them to innovate with flexibility and autonomy.\n\nAs a member of our team, you will:\n• Work with an extremely talented, motivated, supportive and welcoming team in an Agile ecosystem to design new features for TDS, develop new capabilities using the latest open-source frameworks, and work directly with end-users to ensure TDS is solving their mission needs.\n• Develop features, bug fixes, and automated workflows for the system using Python 3, Docker, Kubernetes and AWS services.\n• Embrace opportunities for technical leadership and mentor other team members\n• Drive technical discussions and be proactive in identifying and resolving issues.\n• Contribute to SDLC and coding best practices.\n• Develop and design RESTful APIs and streaming services.\n• Identify and resolve performance bottlenecks.\n\nDoes this sound like a challenge you’d like to embrace?\n\nHere are some of the skills we are looking for:\n• United States Citizenship: Due to clearance and contractual requirements, all candidates must be able to obtain and maintain a US Government issued security clearance of Top Secret or higher.\n• At least 5 years of backend development experience, ideally in AWS Cloud environments\n• Fundamental understanding of cloud computing concepts (serverless, scalability, microservices, high availability, and durability)\n• Experience with integrating Kubernetes, Docker or other containerized ecosystems\n• Relational database design, implementation, configuration, and query experience\n• Experience designing, implementing, and maintaining database indexes and/or optimizing database queries\n• Familiarity with object-oriented design and languages. Most of our developers write Python and/or JavaScript.\n• Comfortable working with Linux (Ubuntu) based operating systems (command line operations, scripting)\n• Configuration Management (CM) experience using Git and familiarity with branching strategies\n• Enjoy learning new technologies and creating compelling software.\n• Work with minimum supervision as part of a collaborative, agile team.\n• BA/BS or higher in Computer Science, Computer Engineering or closely related field\n\nExtra credit if you have:\n• Interest in AI/ML algorithm deployment at scale.\n• Experience with React (preferred) or similar frameworks such as Angular.js\n• Testing experience with some of the following, Storybook, Jest, Cypress, msw\n• 5+ years' work experience with AWS services such as Lambda, DynamoDB, RDS, CloudFormation, EC2, ALB, IAM, and SQS (need not have experience with all)\n• Active TS/SCI security clearance\n\nClearance Required: Secret\n\nWho is Expedition Technology?\n\nExpedition Technology designs, develops, and delivers innovative, advanced signal, image, and multi-INT solutions for the defense and intelligence communities. We leverage advanced algorithms, platforms, and technologies to solve our customers’ most complex, demanding, and urgent C4ISR challenges. Our culture promotes individual growth and opportunity, prioritizes a collaborative team spirit, and invites the intellectually curious to creatively solve challenging problems. Headquartered in Northern Virginia’s high-tech corridor, EXP is a rapidly growing, privately held, employee-owned company that pushes the boundaries of what is possible every day.\n\nInterested in joining our team? Let’s explore together.\n\nTo learn more about EXP and discover why we are an award-winning workplace, visit our web site and follow us on LinkedIn.\n\nWhat do we offer our team?\n\nExpedition Technology (EXP) offers a flexible, self-directed benefits package that is designed to fit your individual needs. Benefits include:\n• Company-paid, medical, dental and vision insurance\n• Up to 45 days of PTO\n• Up to 12% 401k match - Traditional and Roth options available\n• Student loan repayment assistance\\\n• Paid Family Leave\n• Tuition Reimbursement - $5250/year available\n• Referral bonus program\n• Free tickets to sporting events, theater, concerts and more\n• Free, onsite fitness center, onsite cafeteria with reduced-cost meals\n• A collaborative, creative and supportive culture where you will be encouraged to push boundaries, take risks and enjoy the rewards.\n\nEXP is proud to be an Equal Opportunity Employer that believes a diverse range of talent creates an environment that fosters creativity and innovation. All qualified applicants will receive consideration for employment without regard to race, color, religion, sex, sexual orientation, gender identity, age, disability, national origin, genetic information, or protected veteran status.",
